import styled from 'styled-components';

export default function About() {
  return(
    <Container>
      <Title>
        <p>{'<'}</p>
        <h1>Jordan Moore</h1>
        <p>{'/>'}</p>
      </Title>
    </Container>
  )
};

const Container = styled.div`
  height: 100vh;
  background: rgba(75,50,90);
`;

const Title = styled.div`
  display: flex;
  color: var(--light);
  font-size: 500%;
  letter-spacing: normal;
  transition: all 2s;
  align-items: center;

  h1:hover {
    letter-spacing: 0.025em;
  }

  h1 {
    letter-spacing: normal;
    transition: all 2s;
  }

  p {
    font-size: 1em;
    padding: 0 0.5em;
  }
`;
